برای این کار کافیه از تنظیمات گوشی به قسمت برنامه ها برید ، برنامه ی اینستاگرام رو انتخاب کنید ، بعد روی App Permissions ( مجوز های برنامه ) بزنید و از اونجا روی Location ( مکان ) بزنید ؛ بعد نقطه ی آخری یعنی Don't Allow ( مجاز نبودن ) رو بزنید .

در بعضی از گوشی ها جای Don't Allow کلمه ی Deny نوشته شده که باید روی اون بزنید .

